var n=(0,t.createTemplateFactory)({id:"m5/ZycTo",block:'[[[10,"section"],[12],[1,"\\n    "],[10,"h3"],[12],[1,"Overview"],[13],[1,"\\n    "],[10,2],[14,0,"body-text"],[12],[1,"\\n        zyLabs is a program assignment auto-grader, currently supporting Java, Python, C, C++, MATLAB"],[10,"sup"],[12],[1,"®"],[13],[1,", Web Programming (HTML/CSS/JavaScript), and Databases (SQL). Key features:\\n    "],[13],[1,"\\n    "],[10,"ul"],[14,0,"body-text"],[12],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Easy authoring."],[13],[1," Instructors/TAs create new assignments in just tens of minutes via a web interface -- no installations, scripting, or special expertise. Just create the specification for the student and list test cases. Some instructors create 50 or 100 assignments for a term, small and large.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Immediate feedback."],[13],[1," Students submit and get a score based on the test cases passed. They can re-submit for a better score. Immediate feedback can improve learning and reduce frustration.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Integrated."],[13],[1," zyLabs is a low-cost add-on to any zyBook, integrated into its chapters -- no extra logins, data transfers, etc.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Built-in coding window."],[13],[1," Students can code directly in the zyBook making the first few weeks of class, or even the entire term, super smooth. Built-in coding window is available in Java, Python, C, C++, MATLAB®, and Databases.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"File uploads."],[13],[1," Students can drag and drop files to submit for Java, Python, C, C++, and Web Programming -- a simple way to work with an external IDE.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Cost savings."],[13],[1," Auto-grading saves instructors and departments time and money.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Examples."],[13],[1," zyBooks provides example labs at no extra cost. Instructors can use the example labs right out of the box or make changes before use.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Time gating (Flexible lab time)."],[13],[1," Instructors can set up windows in which a zyLab is available -- a useful option for exams or courses with multiple lab sessions.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Use standalone."],[13],[1," zyLabs can also be used standalone for classes using a different book or no book.\\n        "],[13],[1,"\\n    "],[13],[1,"\\n    "],[10,2],[14,0,"body-text"],[12],[1,"\\n        We like to call zyLabs \\"the easiest-to-use program auto-grader on the planet.\\"\\n    "],[13],[1,"\\n"],[13],[1,"\\n"],[10,"section"],[12],[1,"\\n    "],[10,"h3"],[12],[1,"Create your own or use our labs"],[13],[1,"\\n    "],[10,2],[14,0,"body-text"],[12],[1,"\\n        The price of zyLabs is for the auto-grading system. zyBooks provides example labs at no extra cost.\\n    "],[13],[1,"\\n    "],[10,2],[14,0,"body-text"],[12],[1,"\\n        "],[10,"b"],[12],[1,"One large program (OLP)."],[13],[1," Some labs are suitable for traditional one large program (OLP) weekly assignments, each consisting of the large program labeled with an asterisk (*) and \\"Program,\\" and some smaller warm-up labs labeled \\"Warm up.\\" Instructors should treat those as their own programs, being very familiar with each, and ready to answer questions that new learners have (learning programming is hard!).\\n    "],[13],[1,"\\n    "],[10,2],[14,0,"body-text"],[12],[1,"\\n        "],[8,[39,0],null,[["@color","@icon"],["orange","new_releases"]],null],[1," "],[10,"b"],[12],[1,"Many small programs (MSPs)."],[13],[1," We also provide many small programs (MSPs) for Java, Python, C, and C++. MSPs are less intimidating, enabling students to get started more quickly and to pivot among MSPs when stuck (\\"self-help\\"). Research shows MSPs (enabled by auto-grading) lead to happier students and better performance in CS1 classes; see this "],[10,3],[14,6,"https://www.asee.org/public/conferences/106/papers/21762/view"],[14,"rel","noopener noreferrer"],[14,"target","_blank"],[12],[1,"research paper"],[13],[1,". Analysis also shows MSPs CS1 students do fine in a later OLP CS2.\\n    "],[13],[1,"\\n    "],[10,2],[14,0,"body-text"],[12],[1,"\\n        "],[8,[39,0],null,[["@color","@icon"],["orange","new_releases"]],null],[1," "],[10,"b"],[12],[1,"zyBooks-maintained labs (ZMLs)."],[13],[1," By request, we now provide zyBooks-maintained labs (ZMLs). Maintenance may include zyBooks improving labs each term, modifying/replacing some labs each term to reduce copying, and fixing errors on the fly. We also plan to add advanced techniques like automated hints. These labs have a \\"zyBooks maintained\\" label that only instructors see. You can use ZMLs directly or copy them so you can edit.\\n    "],[13],[1,"\\n"],[13],[1,"\\n"],[10,"section"],[12],[1,"\\n    "],[10,"h3"],[12],[1,"Advice"],[13],[1,"\\n    "],[10,2],[14,0,"body-text"],[12],[1,"\\n        Porting traditional programming assignments to zyLabs is OK, but our experience has taught us that auto-graded labs might be best used as follows:\\n    "],[13],[1,"\\n    "],[10,"ul"],[14,0,"body-text"],[12],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Avoid console I/O."],[13],[1," Instead, just create programs that read input data and print output data. Keep formatted output to a minimum. The auto-grading test cases will be more comprehensible to students.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Start straightforward."],[13],[1," Many instructors get excited by auto-grading options and go a little overboard (if we may say so). We recommend starting with straightforward initial assignments using simple test cases. You may find those give you most of the bang for the buck.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Use many small programs."],[13],[1," Auto-graders enable you to assign more labs, each shorter than traditional weekly labs, so students get more practice on a week\'s key concepts. Our company\'s professors create 5 to 7 labs per week -- 2 easy, 3 medium, and 2 hard, each requiring about 20-25 minutes on average. Students start earlier, gain confidence, and switch among labs if stuck.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Use zyBooks-maintained labs."],[13],[1," If you are teaching CS1 in Java, Python, C, or C++, considering using our ZMLs. They are widely tested, and we\'ll be continually improving them. Instead of focusing on creating labs, you can focus on helping students learn.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Use a grade threshold."],[13],[1," Immediate score feedback enables you to develop student-friendly grading policies. We make our 7 labs with 10 points each (a few points for each test case) and require only 50 points (of 70 possible) per week for full credit. Some instructors give extra credit for points beyond the threshold.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Select a subset."],[13],[1," If using our examples, instructors may need to choose a subset; the number of provided examples may be more than appropriate for one course. For Java/Python/C/C++, we recommend starting with our MSPs, requiring perhaps 5 to 7 per week.\\n        "],[13],[1,"\\n        "],[10,"li"],[12],[1,"\\n            "],[10,"b"],[12],[1,"Provide help resources."],[13],[1," Learning to program is hard. Students need help at all hours. We recommend you provide as much help as you can, like a forum (Piazza, Slack, GroupMe, etc.) for discussion with students/instructors, email, office hours, scheduled lab times, etc. If you\'d like to encourage us to provide teaching assistants, let us know! Contact your account executive or email "],[10,3],[14,6,"mailto:sales@zybooks.com"],[12],[1,"sales@zybooks.com"],[13],[1,".\\n        "],[13],[1,"\\n    "],[13],[1,"\\n"],[13],[1,"\\n"]],[],false,["zb-icon"]]',moduleName:"zybooks-web/components/modals/about-zybook/zylabs-about/template.hbs",isStrictMode:!1})
